    comment: 'Foi minha primeira viagem sozinha, e eu estava bem apreensiva por isso! Mas escolher a <a href="http://www.tourchapada.com/" target="_blank">Tour Chapada</a> fez toda a diferena, me senti "em casa"! Tive a felicidade de encontrar um grupo de pessoas maravilhosas, com as quais me diverti muiiito! O <a href="http://www.tourchapada.com/" target="_blank">Helio Ameida</a>  uma pessoa super interessante! Com um jeito simples ele presta um excelente servio, deixando a impresso de que vc foi recebido por um amigo! O guia Alex Moreira tambm contribuiu para o sucesso do passeio! Amigo, prestativo e garantiu lindas fotos! (Alis, isto foi incrvel! Voc aproveita o passeio, enquanto eles garantem os melhores registros! Muito bom!). Quanto ao lugar,  perfeito! Fui no perodo chuvoso, mas at a chuva fez com que o passeio se tornasse mais gostoso e excitante! Energia revigorada para a agitao do dia a dia! Sa de <a href="http://www.viladesaojorge.com/" target="_blank">So Jorge</a> com vontade de voltar! Vida longa para a <a href="http://www.tourchapada.com/" target="_blank">Tour Chapada</a>! Sucesso!'
}, { name: 'Cristiane Sales - Jacare / SP',
