}, { name: 'Marina Lopes - Fortaleza / Cear',
    link: 'https://www.facebook.com/mar.lops.1',
    comment: 'Com o intuito de otimizar o pouco tempo que teria para conhecer a Chapada dos Veadeiros resolvi pela primeira vez contratar os servios de uma agncia de turismo. A ideia de ficar presa a um pacote fechado com um grupo desconhecido me exasperou um pouco. Mas grande foi minha surpresa e acho que isso se deve ao profissionalismo da agncia escolhida. <a href="http://www.tourchapada.com/" target="_blank">Helio</a> e o guia Alex so extremamente atenciosos, pacientes e compromissados com o grupo. O roteiro  bem elaborado, proporcionando uma bela viso desse lugar mgico. Minha imensa gratido, <a href="http://www.tourchapada.com/" target="_blank">Tour Chapada</a>. Bons ventos nesse navegar e at mais. '
}, { name: 'Vivian Moutinho  Rio de Janeiro / RJ',
    link: 'https://www.facebook.com/vivian.moutinho',
